import React from 'react'
import '../Css/NewsFeed.css'
import { Link } from 'react-router-dom'

function NewsFeed() {
    return (
        <div>
            {/* News Feed Navbar */}
            <nav className="feeds-nav">
                <div class="icons">
                    <Link to="/" className="active"><i className="fas fa-home"></i> Home </Link>
                    <Link to="/" className="active" ><i className="fas fa-hashtag"></i> Explore </Link>
                    <Link to="/" className="active" ><i className="far fa-bell"></i> Notifications </Link>
                    <Link to="/" className="active"><i className="far fa-envelope"></i> Messages </Link>
                </div>

            </nav>

            {/* End of News Feed Navbar */}
        </div>
    )
}

export default NewsFeed
